import axios, { AxiosResponse } from "axios";

const getNews = (): Promise<AxiosResponse> => {
  const requestUrl = "https://api.tvmaze.com/search/shows?q=girls ";
  const response = axios.get(requestUrl);
  return response;

};
export default getNews;
